import { Fragment } from 'react'
import Item from './Item'

const Items = ({ items, addToCart }) => {

    return(
        <>
            {items.map((item, index) => (
                <Item key={index} item={item} addToCart={addToCart} />
            ))}
        </>
    )
}

export default Items
